import React, { useState } from "react";
import { Modal, Button, ListGroup } from "react-bootstrap";

function ModalPages({ showAddProjectModal, setShowAddProjectModal, showProjectDescriptionModal, setShowProjectDescriptionModal, showAvailableDevelopersModal, setShowAvailableDevelopersModal, projectDescription, setProjectDescription, deleteProject, editProjectDescription, developers }) {

  function addProject(event: MouseEvent<HTMLButtonElement, MouseEvent>): void {
    throw new Error("Function not implemented.");
  }

  return (
    <div>
      {/* Add Project Modal */}
      <Modal
        show={showAddProjectModal}
        onHide={() => setShowAddProjectModal(false)}
      >
        <Modal.Header closeButton>
          <Modal.Title>Add Project</Modal.Title>
        </Modal.Header>
        <Modal.Body>{/* Your add project form content goes here */}</Modal.Body>
        <Modal.Footer>
          <Button
            variant="secondary"
            onClick={() => setShowAddProjectModal(false)}
          >
            Close
          </Button>
          <Button variant="dark" onClick={addProject}>
            Submit
          </Button>
        </Modal.Footer>
      </Modal>

      {/* Project Description Modal */}
      <Modal
        show={showProjectDescriptionModal}
        onHide={() => setShowProjectDescriptionModal(false)}
      >
        <Modal.Header closeButton>
          <Modal.Title>Project Description</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>{projectDescription}</p>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="danger" onClick={deleteProject}>
            Delete
          </Button>
          <Button variant="dark" onClick={editProjectDescription}>
            Edit
          </Button>
        </Modal.Footer>
      </Modal>

      {/* Available Developers Modal */}
      <Modal
        show={showAvailableDevelopersModal}
        onHide={() => setShowAvailableDevelopersModal(false)}
      >
        <Modal.Header closeButton>
          <Modal.Title>Available Developers</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <ListGroup>
            {developers.map((developer, index) => (
              <ListGroup.Item key={index}>{developer}</ListGroup.Item>
            ))}
          </ListGroup>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowAvailableDevelopersModal(false)}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default ModalPages;
